  return (
    <div className="App">
      <div className="search-bar">
      <form className="search-form">
        <input 
          type="text"
          placeholder="search for creature here"
          ></input>
          <button type="submit">search</button>
          </form>
      </div>


      <div className="fish-container">
        {fishList.map(creature => (
          <CreatureCard
            name={creature.name}
            location={creature.location}
            price={creature.price}
          />
        ))}
      </div>

      <div className="bugs-container">
        {bugList.map(creature => (
          <CreatureCard
            name={creature.name}
            location={creature.location}
            price={creature.price}
          />
        ))}
      </div>
    </div>
  );
}


export default App;
